import React from "react";

export default function () {
  const days = [
    "Sunday",
    "Monday",
    "Tuesday",
    "Thursday",
    "Friday",
    "Saturday",
  ];
  const DayBoxes = days.map((day) => <span>{day}</span>);
  return (
    <div className="calendar-header">
      {DayBoxes}
    </div>
  );
}
